import React, { Component } from 'react';
import TodoList from './TodoList';

class App extends Component {
  state ={
    tasks: [],
  }

  handleProps = (task) => {
    this.state.tasks.push(task)
  }

  render () {
    return (
      <div>
        <TodoList handleProps={this.handleProps}/>

      </div>
    );
  }
}

export default App;
